import React, { Component } from 'react'

export default class Studentpprofile extends Component {
    render() {
        return (
            <div>
                <div className="cmd">

                    <label><h2>add details</h2></label>
                    <form onSubmit={this.handlesubmit}>
                        <input type="text" id="name" placeholder="fullname" /><br />

                        <input type="password" id="fathername" name="fathername" placeholder="fathername"  /><br />

                        <input type="password" id="fathername" name="fathername" placeholder=""  /><br />

                        <input type="password" id="fathername" name="fathername" placeholder="fathername"  /><br />

                        <input type="submit" value="Login"></input>
                    </form>

                </div>
            </div>
        )
    }
}
